async function start() {
    provider = web3.currentProvider;
    assetFormInput.prop("disabled", false);
    metamaskStatus.hide()
    // metamaskEvents()
    getEthNetworkId()
        .then(function (networkId) {
            if (networkId === '56') {
                isBSCMainnet = true;
                currentNetwork.text('Connected to Binance Smart Chain Mainnet').show();
            } else if (networkId === '97') {
                isBSCTestnet = true;
                currentNetwork.text('Connected to Binance Smart Chain Testnet').show();
            } else if (networkId === '1') {
                isRinkeby = true;
                currentNetwork.text('Connected to Ethereum Mainnet').show();
            } else if (networkId === '3') {
                isGoerli = true;
                currentNetwork.text('Connected to Ropsten Testnet').show();
            } else
                currentNetwork.text('Your current network id is ' + networkId).show();
        })
        .fail(function (err) {
            console.log(err)
        });

    setInterval(function () {
        isLocked()
            .then(function (isLocked) {
                if (isLocked) {
                    isMetaMaskLocked = true;
                    metamaskUnlocked.hide();
                    accountAddress.hide();
                    metamaskLocked.show();
                    assetFormInput.prop("disabled", true);
                    throw Error("Metamask Locked");
                }
                metamaskUnlocked.show();
                metamaskLocked.hide();

                return getAccount()
            })
            .then(function (account) {
                if (account.length > 0) {
                    if (isMetaMaskLocked) {
                        isMetaMaskLocked = false;
                        assetFormInput.prop("disabled", false);
                    }
                    address = account[0];
                    return getBalance(account[0]);
                }
            })
            .then(function (balance) {
                if(document.getElementById('bnbToken') === null && document.getElementById('etherToken') === null) {
                    accountAddress.html('<strong>Selected Account: ' + address + ' (' + balance + ' )').show();
                } else
                if(document.getElementById('bnbToken').checked) {
                    accountAddress.html('<strong>Selected Account: ' + address + ' (' + balance + ' BNB)</strong>').show();
                } else if(document.getElementById('etherToken').checked) {
                    accountAddress.html('<strong>Selected Account: ' + address + ' (' + balance + ' ETH)</strong>').show();
                }
            })
            .fail(function (err) {
                if (err.message !== "Metamask Locked")
                    console.log(err)
            });
    }, 1000);
}

function sendSync(params) {
    var defer = $.Deferred();
    provider.sendAsync(params, function (err, result) {
        if (err)
            return defer.reject(err.json());
        if (result['error'])
            return defer.reject(result['error']);
        defer.resolve(result)
    }
    );
    return defer.promise();
}

function getEthNetworkId() {
    return sendSync({ method: 'net_version', params: [] })
        .then(function (result) {
            return result['result'];
        })
        .fail(function (err) {
            return err
        })
}

function requestAccounts() {
    return sendSync({ method: 'eth_requestAccounts' })
        .then(function (result) {
            return result['result'];
        })
        .fail(function (err) {
            return err;
        })
}

function getAccount() {
    return sendSync({ method: 'eth_accounts', params: [] })
        .then(function (result) {
            return result['result'];
        })
        .fail(function (err) {
            return err;
        })
}

function getBalance(address) {
    return sendSync({ method: 'eth_getBalance', params: [address] })
        .then(function (result) {
            return web3.utils.fromWei(result['result']);
        })
        .fail(function (err) {
            return err;
        })
}

function isLocked() {
    return getAccount()
        .then(function (accounts) {
            return accounts.length <= 0;
        })
        .fail(function (err) {
            return err
        });
}

